description:
(A)sexual - Not everybody's doing it

Sociopolitical Documentary with no narration published by Filmbuff in 2011 - English language


Information
------------------------------

&quot;(A)sexual&quot; - a documentary that seeks to illuminate and share the stories of the one percent of the population who experience no sexual attraction. &quot;(A)sexual&quot; portrays an alternative lifestyle that is very rarely recognized or talked about and shows how this small group exists in an over-saturated and hyper-sexualized society.
The film presents candid interviews and confessions from members of the asexual community, revealing how they exist without sex within a sex-obsessed culture. The doc shows how the alternative and mainstream media have unfortunately misunderstood and misrepresented the often maligned and ridiculed group, revealing the dismissive attitudes that both the LGBT and straight communities have adopted towards them. &quot;(A)sexual&quot; challenges existing notions of sexuality and provides a look into a marginalized group striving to have their voice heard.

